descriptif:
Créée en mai 2001, la Cie a pour objectif d’ouvrir au plus grand nombre l’accès à la danse contemporaine. Divertir (spectacles), former (interventions sous forme d’ateliers) et informer (rencontres, échanges) tout en tissant un lien fédérateur entre les artistes et le public concerné (établissements scolaires, structures d’accueil…).En concevant la danse comme un moyen privilégié d’expression et de développement, la démarche de la compagnie A petits pas s’inscrit dans une double volonté :
- ouvrir le public à la danse contemporaine en lui proposant des créations chorégraphiques adaptées ;
- initier le public à la pratique de la danse contemporaine
